tki podczas podróży. Zapakujesz do niej wszystko to, czego potrzebujesz do dziergania.Torba wykonana jest z miękkiej bawełny we wzór w paseczki. Wewnątrz wykończona jest poliestrową podszewką.Wymiary torby: 22 x 27cmPielęgnacja: można prać w pralce w zimnej wodzie na delikatnym cyklu. Nie prasować, nie wybielać, nie suszyć w suszarce bębnowej.','','petiteknit-torba-projektowa-edycja-limitowana','Torba projektowa PetiteKnit z edycji limitowanej Ta baweniana torba pozwoli Ci zorganizowa Twoje robtki podczas podry Zapakujesz do niej wszystko to czego potrzebujesz do dzierganiaTorba wykonana jest z mikkiej baweny we wzr w paseczki Wewnt','tag','title','PetiteKnit - torba projektowa - EDYCJA LIMITOWANA','','','',''),(668,1,1,'Bawełniany worek dziewiarski PetiteKnit z edycji limitowanej! Przyda Ci się, aby schować do środka robótkę. Worek wykonany jest z miękkiej bawełnianej tkaniny. Całość ściągana jest troczkiem.Wymiary: 30 x 34cmPielęgnacja: można prać w pralce w zimnej wodzie na delikatnym cyklu. Nie prasować, nie suszyć w suszarce bębnowej, nie wybielać.','','petiteknit-worek-dziewiarski-edycja-limitowana','Baweniany worek dziewiarski PetiteKnit z edycji limitowanej Przyda Ci si aby schowa do rodka robtk Worek wykonany jest z mikkiej bawenianej tkaniny Cao cigana jest troczkiemWymiary 30 x 34cmPielgnacja mona pra w pralce w zimnej wodz','tag','title','PetiteKnit - worek dziewiarski - EDYCJA LIMITOWANA','','','',''),(669,1,1,'Knitter\'s Needle Case To Go to bawełniane etui zaprojektowane przez duńską markę PetiteKnit. Zmieścisz w nim wszystkie akcesoria, których będziesz potrzebować podczas dziergania w podróży. Idealnie rozmieszczone kieszonki pozwolą na przechowanie  drutów na żyłce lub skarpetkowych. Zmieścisz tu również nożyczki, żyłki lub inne drobne akcesoria.Etui wykonane jest z bawełny.Rozmiar: 21 x 22cmPielęgnacja: można prać w pralce w zimnej wodzie na delikatnym programie. Nie wybielać, nie suszyć w suszarce bębnowej.U','','etui-na-druty-knitter-s-needle-ca