k na drutachAnna Husemann to niemiecka projektantka dzianin wykorzystujca w swoich projektach technik','tag','title','Intarsia Knits','','','',''),(917,1,1,'\"Dreamy Knits\"to 21 miękkich i wspaniałych wzorów na druty, starannie wyselekcjonowanych z inspiracji zebranych podczas spacerów po Helsinkach. Od pięknych swetrów z koronkowymi wzorami po haftowane skarpetki, czapki z warkoczami i prostsze codzienne dzianiny. Znajdziesz tutaj wzory na każdą okazję i na każdą porę roku. Książka jest przeznaczona dla osób robiących na drutach na każdym poziomie, niezależnie od tego, czy dopiero zaczynają, czy chcą zgłębić bardziej zaawansowane techniki. Wszystkie wzory są wy','','dreamy-knits','Dreamy Knitsto 21 mikkich i wspaniaych wzorw na druty starannie wyselekcjonowanych z inspiracji zebranych podczas spacerw po Helsinkach Od piknych swetrw z koronkowymi wzorami po haftowane skarpetki czapki z warkoczami i prostsze codzienne dzia','tag','title','Dreamy Knits','','','',''),(918,1,1,'Data publikacji: 26 listopada 2024Veronika Lindberg jest jedną z najpopularniejszych projektantek wzorów dziewiarskich. Jej nowa książka, Knits to Wear: Effortless Patterns zawiera 17 wzorów, które staną się Twoimi ulubionymi. Kolekcja oferuje inspirację, która pomoże Ci stworzyć dzianiny odzwierciedlające Twój styl i przynoszące Ci radość za każdym razem, gdy je nosisz.Autorka książki - Veronika Lindberg - znana również jako Kutova Kika, jest międzynarodową uznaną projektantką odzieży dzianinowej. Jest zna','','knits-to-wear-effortless-patterns-by-kutova-kika','Data publikacji 26 listopada 2024Veronika Lindberg jest jedn z najpopularniejszych projektantek wzorw dziewiarskich Jej nowa ksika Knits to Wear Effortless Patterns zawiera 17 wzorw ktre stan si Twoimi ulubionymi Kolekcja oferuje inspiracj','tag','title','Knits to Wear: Effortless Patterns by Kutova Kika','','','',''),(919,1,1,'Stado owiec mieszczące się na dłoni, tygrys mniejszy od filiżanki oraz miniaturowy kangur - wszystko to wyczaro