yć trwałe kolory, jednocześnie szanując środowisko i świat przyrody.Emma Kylmälä, fińska naturalna farbiarka mieszkająca w Londynie, upraw','','dyeing-naturally','Wkrocz do wiata naturalnego barwienia pokoloruj przdze do projektw dziewiarskich daj nowe ycie domowym tekstyliom lub zrb tusze z rolin aby cieszy si spektrum sezonowych odcieni Zbierz letnie zbiory i otul si rolinnymi odcieniami Poznaj pod','tag','title','Dyeing Naturally','','','',''),(922,1,1,'Data premiery: 18 października 2024W \"Cultivate\" autorki łączą siły, aby świętować piękno rodzinnej prostoty poprzez sztukę robienia na drutach. Ta kolekcja, obejmująca 20 ponadczasowych wzorów, łączy botaniczne szaliki Dee - bogate w motywy inspirowane naturą - z prostymi, eleganckimi ubraniami Jonny.Liczba projektów: 20 (15 szali, 3 swetry, 2 sukienki).Oprawa: miękkaIlość stron: 168Książka wydana w języku angielskim. Jest to wersja drukowana (brak kodu do pobrania wersji elektronicznej).Prosimy przemyśl s','','cultivate-dee-hardwicke-i-jonna-helin','Data premiery 18 padziernika 2024W Cultivate autorki cz siy aby witowa pikno rodzinnej prostoty poprzez sztuk robienia na drutach Ta kolekcja obejmujca 20 ponadczasowych wzorw czy botaniczne szaliki Dee  bogate w motywy inspirowane n','tag','title','CULTIVATE - Dee Hardwicke i Jonna Helin','','','',''),(923,1,1,'Premiera: 17 września 2024Memory Lane to 19 czarujących wzorów do robienia na drutach. Dzięki przemyślanym zdobieniom takim jak haft, koronka, koraliki, proste wzory przekształcają się we wspaniałe, jedyne w swoim rodzaju dzieła.Claudia Quintanilla jest projektantką wzorów dziewiarskich. Mieszka w Toronto, gdzie prowadzi sklep z włóczkami Eweknit&amp;Craft. Porzuciła studia doktoranckie z literatury, aby realizować swoje marzenie: projektowanie wyjątkowych ubrań inspirowanych życiem i sztuką.Szczegóły:- oprawa ','','memory-lane-claudia-quintanilla','Premiera 17 wrzenia 2024Memory Lane to 19 czarujcych wzorw do robienia na drutach Dziki przemylanym zdobienio